import { Link } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Home.css';
import logoIcon from 'logo.png';

const Home = () => {
  return (
    <div className="App">
      <header className="App-header">
        <Container>
          <Row className="justify-content-center align-items-center">
            <Col xs={12} className="text-center">
              <h1 className="logo-text">thriftify</h1>
              <img src={logoIcon} alt="map with hanger logo" className="img-fluid" />
            </Col>
          </Row>
          <Row className="justify-content-center align-items-center">
            <Col xs={12} sm={6} className="text-center">
              <Link to="/UploadPage" className="btn btn-block upload-listing">
                upload listing
              </Link>
            </Col>
            <Col xs={12} sm={6} className="text-center mt-3 mt-sm-0">
              <Link to="/offers" className="btn btn-block view-listings">
                view listings
              </Link>
            </Col>
          </Row>
        </Container>
      </header>
    </div>
  );
};

export default Home;
